<!DOCTYPE html PUBLIC "-//W3C//DTD HTML 4.01//EN" "http://www.w3.org/TR/html4/strict.dtd">
<html>
<head>
  <meta http-equiv="Content-Type" content="text/html; charset=utf-8">
  <meta http-equiv="Content-Style-Type" content="text/css">
  <title></title>
  <meta name="Generator" content="Cocoa HTML Writer">
  <meta name="CocoaVersion" content="1894.4">
  <style type="text/css">
    p.p1 {margin: 1em; font: 12.0px Roboto; color: #000000; -webkit-text-stroke: #000000}
    span.s1 {font-kerning: none}
  </style>
</head>
<body>
<p class="p1"><span class="s1"><br>
<span class="Apple-converted-space"> </span>{% seo %}</span></p>
<p class="p1"><span class="s1">{{ content }} <br>
<span class="Apple-converted-space"> </span>{% if site.github.private != true and site.github.license %}</span></p>
<p class="p1"><span class="s1">This site is open source. {% github_edit_link "Improve this page" %}.<span class="Apple-converted-space"> </span></span></p>
<p class="p1"><span class="s1">{% endif %}<span class="Apple-converted-space"> </span></span></p>
<p class="p1"><span class="s1">{% if site.google_analytics %} {% endif %}<span class="Apple-converted-space"> </span></span></p>
</body>
</html>
